import { NavLink } from "react-router-dom";

const categoriesBack = ['audio', 'electronica', 'gaming', 'imagen', 'informatica', 'musica', 'telefonos']

function Categories () {

    return (
        <ul>
            <li><NavLink to={`/`}>Todos</NavLink></li>
            {categoriesBack.map(category =>
                <li key={category}><NavLink to={`/article/byCategory/${category}`}>{category}</NavLink></li>
                )}
        </ul>
    )
}

export default Categories
